// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

contract Bank {
    address public admin;
    mapping(address => uint256) public balances;

    // 前三名存款用户及其金额
    address[3] public topUsers;
    uint256[3] public topAmounts;

    constructor() {
        admin = msg.sender;
    }

    // 允许直接转账到合约
    receive() external payable {
        deposit();
    }

    // 也可以通过调用 deposit 存款
    function deposit() public payable {
        require(msg.value > 0, "Must be greater than 0.");
        balances[msg.sender] += msg.value;
        _updateTopUsers(msg.sender);
    }

    // 仅管理员可提取全部资金
    function withdraw() public {
        require(msg.sender == admin, "Only the administrator can extract.");
        payable(admin).transfer(address(this).balance);
    }

    // 内部函数：更新前三名
    function _updateTopUsers(address user) internal {
        uint256 userBalance = balances[user];

        // 检查是否已在前三名
        for (uint i = 0; i < 3; i++) {
            if (topUsers[i] == user) {
                topAmounts[i] = userBalance;
                _sortTopUsers();
                return;
            }
        }

        // 检查是否能进入前三
        for (uint i = 0; i < 3; i++) {
            if (userBalance > topAmounts[i]) {
                // 插入到第i名，后移
                for (uint j = 2; j > i; j--) {
                    topUsers[j] = topUsers[j-1];
                    topAmounts[j] = topAmounts[j-1];
                }
                topUsers[i] = user;
                topAmounts[i] = userBalance;
                break;
            }
        }
    }

    // 内部函数：按金额降序排序前三名
    function _sortTopUsers() internal {
        for (uint i = 0; i < 2; i++) {
            for (uint j = i+1; j < 3; j++) {
                if (topAmounts[j] > topAmounts[i]) {
                    // 交换
                    (topAmounts[i], topAmounts[j]) = (topAmounts[j], topAmounts[i]);
                    (topUsers[i], topUsers[j]) = (topUsers[j], topUsers[i]);
                }
            }
        }
    }

    // 查询前三名用户和金额
    function getTop3() public view returns (address[3] memory, uint256[3] memory) {
        return (topUsers, topAmounts);
    }
}

